    <script type="text/javascript">
        window.onload = function() {
            jump();
        }
        function jump(flag){
            if (!/micromessenger/i.test(navigator.userAgent)) { 
                var search = window.location.search
                if (/(iPhone|iOS)/i.test(navigator.userAgent)){ 
                    var newUrl = "MUWPAPP://shareFrom=wx&" + search.substr(1, search.length - 1);
                } else {
                    var newUrl = "muwpapp://e_muwp.com/params?" + search.substr(1, search.length - 1);
                }
                // var downloadUrl = 'https://muip.test.bankcomm.com/vpndl.html';
                // var iosUrl = "MUIPAPP://shareFrom=wx&" + search.substr(1, search.length - 1);
                // var androidUrl = "muipapp://e_muip.com/params?" + search.substr(1, search.length - 1);
                if(flag){
                    TestJump(iosUrl, androidUrl, '','',undefined);
                    // setTimeout(function() {
                    //     window.location.href = downloadUrl;
                    // }, 800);
                }else{
                    TestJump(iosUrl, androidUrl, '','',undefined);
                    // setTimeout(function() {
                    //     document.getElementById("boxalert").style.display="block";
                    // }, 800);
                }
            } else {
                document.getElementById("wxalert").style.display="block";
            }
        }
        function TestJump(iosOpenUrl,androidOpenUrl,iosDownUrl,androidDownUrl, intent){
            // let iosOpenUrl = '';
            // let androidOpenUrl = '';
            // let iosDownUrl = '';
            // let androidDownUrl = '';
            // let intent = intent;//安卓原生谷歌浏览器必须传Internet协议，才能唤起APP
            var UA = window.navigator.userAgent || '';
            var isAndroid = /android/i.test(UA);
            var isIos = !!UA.match(/\(i[^;]+;( U;)? CPU.+Mac OS X/);
            var isWecaht = /micromessenger\/([\d.]+)/i.test(UA);
            var isWeibo = /(weibo).*weibo__([\d.]+)/i.test(UA);
            var isQQ = /qq\/([\d.]+)/i.test(UA);
            var isQQBrower = /(qqbrowers)\/([\d.]+)/i.test(UA);
            var isQzone = /qzone\/.*_qz_([\d.]+)/i.test(UA);
            var isOriginalChrome = /chrome\/[\d.]+ Mobile Safari\/[\d.]+/i.test(UA) && isAndroid;
            var isSafari = /safira\/([\d.]+)$/i.test(UA) && isIos && UA.indexOf('Crios') < 0 && UA.indexOf('Mozilla') === '0';
            
            var weCahtVersion = navigator.appVersion.match(/micromessenger\/(\d+\.\d+\.\d+)/i) ? navigator.appVersion.match(/micromessenger\/(\d+\.\d+\.\d+)/i)[1] : '';//获取微信版本号
            if(isIos){
                var iosVersion = navigator.appVersion.match(/OS (\d+)_(\d+)_?(\d+)?/);//获取ios大版本号
                iosVersion = parseInt(iosVersion[1], 10);
                if((isWecaht && weCahtVersion < '7.0.5') || isQQ || isQQBrower){
                    window.top.location.href = iosOpenUrl;
                }else if(iosVersion < 9){
                    var iframe = document.createElement('iframe');
                    iframe.frameBorder = '0';
                    iframe.src= iosOpenUrl;
                    iframe.style.cssText='display: none;border:0;width:0;height: 0;';
                    document.body.appendChild(iframe);
                }else{
                    window.top.location.href = iosOpenUrl;
                }
            }else{
                if(isWecaht){
                    window.top.location.href = androidOpenUrl;
                }else if(isOriginalChrome){//安卓的原生浏览器必须传递Intent协议地址，才能唤起APP
                    if(intent){
                        window.top.location.href = androidOpenUrl; 
                    }else{//scheme 在安卓 chorme 25+,版本必须手动触发
                        console.log('wechat')
                        var tagA = document.createElement('a');
                        tagA.setAttribute('href',androidOpenUrl);
                        tagA.style.display = 'none';
                        document.body.appendChild(tagA);
                        tagA.click();
                    }
                }else{
                    //
                    var iframe = document.createElement('iframe');
                    iframe.frameBorder = '0';
                    iframe.src= androidOpenUrl;
                    iframe.style.cssText='display: none;border:0;width:0;height: 0;';
                    document.body.appendChild(iframe);
                }
            }

        };

        
     
    </script>
